var login = async () => {
  const notifications = Notifications.getInstance();
  const config2 = ConnectorSingleton.getInstance();
  try {
    const user = (await config2.userApi.userSnapshot()).user;
    if (!user) {
      await config2.osApi.signIntoOS();
    }
    notifications.information({ message: Constants.SIGNIN_SUCCESS });
    return true;
  } catch (error) {
    notifications.error({ message: Constants.SIGNIN_FAIL });
    return false;
  }
};
var logout = async () => {
  const notifications = Notifications.getInstance();
  const config2 = ConnectorSingleton.getInstance();
  try {
    const user = (await config2.userApi.userSnapshot()).user;
    if (user) {
      await config2.osApi.signOutOfOS();
      notifications.information({ message: Constants.SIGNOUT_SUCCESS });
      return true;
    } else {
      notifications.error({ message: Constants.SIGNOUT_FAIL });
      return false;
    }
  } catch (error) {
    return false;
  }
};

